  [],\n\t\"revision_timestamp\": \"2015-07-08T19:19:02.149530\",\n\t\"name\": \"nenana-ice-classic-tanana-river-ice-annual-breakup-dates\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"nThe Nenana river in the Interior of Alaska
  usually freezes over duringnOctober and November. The ice continues to grow throughout
  the winternaccumulating an average maximum thickness of about 110 cm, dependingnupon
  winter weather conditions.nnThe Nenana River Ice Classic competition began in 1917
  when railroadnengineers bet a total of 800 dollars, winner takes all, guessing the
  exact time (month, day, hour, minute) ice on the Nenana River wouldnbreak up. Each
  year since then, Alaska residents have guessed at thentiming of the river breakup.
  A tripod, connected to an on-shore clocknwith a string, is planted in two feet of
  river ice during rivernfreeze-up in October or November. The following spring, the
  clocknautomatically stops when the tripod moves as the ice breaks up. Thentime on
  the clock is used as the river ice breakup time.nnMany factors influence the river
  ice breakup, such as air temperature,nice thickness, snow cover, wind, water temperature,
  and depth of waternbelow the ice. Generally, the Nenana river ice breaks up in late
  Aprilnor early May (historically, April 20 to May 20). The time series ofnthe Nenana
  river ice breakup dates can be used to indicate climatenchange in the region.n\",\n\t\"license_title\":
